column3:
Brown Girls premieres in 3 weeks! Thanks Broadly for interviewing the creative team. 

Creator/writer Fatimah Asghar says: &quot;I often feel like the more specific a story is, the more universal it feels. Because it feels real.&quot;

Director/producer Samantha Bailey says: &quot;A webseries has always been a way for me to see myself in media in a way that hasn't always been possible. I've always been a fan of work on the internet because it levels the playing field.&quot;

Thank you Out Magazine for covering this exclusive sneak peek of Brown Girls!

Creator Fatimah Asghar says: &quot;I hope that it shows the complications of communities of color and queer communities. So many times American media is shown in binary fashion. I hope this show helps show that's not the reality for many of us. We exist across racial lines all the time, across lines of queerness and sexuality. We are real people who make complicated relationships with each other.&quot;

Full interview with Asghar and Samantha Bailey here: http://www.out.com/out-exclusives/2017/1/19/watch-exclusive-preview-brown-girls-new-queer-web-series-about-two-women-color
